void enter(struct node **node, char *word)
{
  int  result;		/* strcmpの結果 */
  char *save_string();	/* ヒープに文字列をセーブする */
  void memory_error();  /* ユーザに領域がないことを通知する */

  /* 現在のノードがNULLなら、ツリーの最下位の末端に達したことになり
     新しいノードを作成しなければならない */

  if ((*node) == NULL) {

    /* 新しいノード用のメモリを割り当てる */
    (*node) = malloc(sizeof(struct node));
    if ((*node) == NULL)
      memory_error();

    /* 新しいノードを初期化する */
    (*node)->left  = NULL;
    (*node)->right = NULL;
    (*node)->word  = save_string(word);
    return;
  }

  /* 単語がどこにきているかをチェック */
  result = strcmp((*node)->word, word);

  /* 現在のノードが単語と同じであるなら挿入する必要は無い */
  if (result == 0)
    retrun;

  /* 単語を左または右枝に挿入しなければならない */
  if (result < 0)
    enter(&(*node)->right, word);
  else
    enter(&(*node)->left, word);
}
